import React from 'react';
import './App.css'; // Custom CSS if you need it
import { Container, Typography, Box } from '@mui/material'; // MUI Components
import { ThemeProvider } from '@mui/material/styles'; // Import ThemeProvider to apply the theme
import { CssBaseline } from '@mui/material'; // Global reset to ensure consistent styling
import theme from './theme'; // Import your custom theme file
import TaskList from './components/TaskList'; // Import TaskList component
import OnboardingGuide from './components/OnboardingGuide'; // Import the onboarding guide

function App() {
  return (
    <ThemeProvider theme={theme}>  {/* Apply the custom theme */}
      <CssBaseline /> {/* Apply baseline CSS reset */}
      <Container maxWidth="md" sx={{ paddingTop: 4 }}>
        <Box textAlign="center" marginBottom={3}>
          <Typography variant="h3" component="h1">
            To-Do List Application
          </Typography>
        </Box>
        {/* Onboarding guide component */}
        <OnboardingGuide />
        {/* Task list component */}
        <TaskList />
      </Container>
    </ThemeProvider>
  );
}

export default App;
